import React, { Component } from "react";

import Plot from "react-plotly.js";

class DOA extends Component {
  state = {
    chart: {}
  };
  constructor(props) {
    super(props);
    this.state.chart = { msg: "test chart", osX: [], osY: [] };
  }

  render() {
    return <div>Hello</div>;
  }
}

export default DOA;
